import React from "react";
import { useMedia } from "react-use";
import Header from "../../components/Header/Header";
import HeaderCondensed from "../../components/HeaderCondensed/HeaderCodensed";
import NavBar from "../../components/NavBar/NavBar";
import CarouselCategory from "./CarouselCategory/CarouselCategory";
import DestinationsList from "./DestinationsList/DestinationsList";

const Home = () => {
  const isMobile = useMedia("(min-width: 768px)");
  return (
    <div>
      {isMobile}
      <Header />
      <HeaderCondensed />
      <CarouselCategory />
      <DestinationsList />
      {isMobile && <NavBar />}
    </div>
  );
};

export default Home;
